import {
  Box,
  DrawerOverlay,
  Flex,
  Heading,
  IconButton,
  Link,
} from "@chakra-ui/react";
import { memo, VFC } from "react";
import { HamburgerIcon } from "@chakra-ui/icons";

export const Header: VFC = memo(() => {
  return (
    <>
      <Flex
        as="nav"
        bg="teal.500"
        color="gray.50"
        align="center"
        justify="space-between"
        padding={{ base: 3, md: 5 }}
      >
        <Flex align="center" as="a" mr={8} _hover={{ cursor: "pointer" }}>
          <Heading as="h1" fontSize={{ base: "md", md: "lg" }}>
            シフト管理アプリ
          </Heading>
        </Flex>
        <Flex
          align="center"
          fontSize="sm"
          flexGrow={2}
          display={{ base: "none", md: "flex" }}
        >
          <Box pr={4}>
            <Link>シフト</Link>
          </Box>
          <Link>従業員</Link>
        </Flex>
        <IconButton
          aria-label="メニューボタン"
          icon={<HamburgerIcon />}
          size="md"
          variant="unstyled"
          display={{ base: "block", md: "none" }}
        />
      </Flex>
      <Drawer>
        <DrawerOverlay></DrawerOverlay>
      </Drawer>
    </>
  );
});
